// import logo from './logo.svg';
import './App.css';
import { BrowserRouter as Router, Route, Routes} from 'react-router-dom';
import Dasboard from './Component/Dasboard';



function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route path='/auth/dashboard' element={<Dasboard/>} />
        </Routes>
      </Router>

    </div>
  );
}

export default App;
